/*
************************************************************
chendct.c

A simple DCT algorithm that seems to have fairly nice arithmetic
properties.

W. H. Chen, C. H. Smith and S. C. Fralick "A fast computational
algorithm for the discrete cosine transform," IEEE Trans. Commun.,
vol. COM-25, pp. 1004-1009, Sept 1977.

************************************************************
*/

#include<stdio.h>
#include<assert.h>

#define abs(a) ( ((a) < 0) ? -(a) : (a) )
#define LS(r,s) ((r) << (s))
#define RS(r,s) ((r) >> (s))       /* Caution with rounding... */

#define MSCALE(expr)  RS((expr),9)

/* Cos constants */

#define c1d4 362L

#define c1d8 473L
#define c3d8 196L

#define c1d16 502L
#define c3d16 426L
#define c5d16 284L
#define c7d16 100L


#define TESTEXP(i) \
    ret += (y##i[0] == exp[i-1]);

int correct_accuracy(int num) {
      int tmp = ((num<0) ? (num-8) : (num+8));
      // divide by 16 using shift
      // note: shift doesn't match divide if the number is negative
      // For instance: -5 (111011)
      //    -5 / 2 = -2 (111110)
      //    -5 >> 1 = -3 (111101)
      // so we get the absolute value, shift then convert back to neg
      int abstmp = abs(tmp);
      int divBy16 = abstmp >> 4;

      if (tmp < 0) {
          return -divBy16;
      } else {
          return divBy16;
      }
}


